import React from 'react';
import './EverythingView.css';
import { EverythingViewIcons } from './EverythingViewIcons';
import { EverythingViewButtons } from './EverythingViewButtons';

const EverythingView = () => {
  return (
    <div className="everything-view">
      <div className="everything-header">
        <h1>Everything</h1>
        <input type="text" placeholder="Search..." className="search-bar" />
      </div>
      <div className="everything-content">
        <EverythingViewIcons />
        <EverythingViewButtons />
        {/* Diğer içerikler buraya eklenebilir */}
      </div>
    </div>
  );
};

export default EverythingView;
